     function sdklocalhost(etc,segment,set='') {
         var urlautoload=autoload;
         $.ajax({
            type: 'POST',
            url: urlautoload,
            data: 'etc='+etc+'&segment='+segment+'&set='+set,
            success: function(data) {
              cmd.sText(data);
              cmd.startNewCommand();

            }
        });
     }

     function sdkCommand(argument,etc,key='',titel='') {
      if (argument=='dialog') {
             var dataID = 'etc='+ etc +'&keyid='+key;
             $.ajax({
                 type: 'POST',
                 url: Cookies.get("sdkautoload"),
                 data: dataID,
                 success: function(response) {

                  var add = JSON.parse(response);
                  if (add.info !=="sukses") {
                     var split       =titel.split('/');
                     cmd.run(split[1]+' ls');
                     cmd.startNewCommand();
                  } else {
                     sdkDialog(titel,etc,key);
                    
                  }

                 }
             });
      } else {

        $.ajax({
            type: 'POST',
            url: Cookies.get("sdkautoload"),
            data: 'etc='+etc+'&key='+key,
            success: function(data) {
              cmd.output(data);
              cmd.startNewCommand();

            }
        });

      }
        // cmd.startNewCommand();
      
     }

function reload(argument) {
      var destroyLoader = setTimeout(function(){
          location.reload();
     },argument);
}
